      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 * - 75 NOT IN ( + - col0 * + col0, 94 * - 64, + ( + col1 ) / - col0 + + 90 );
  - name: tab2

outputs:
